import React from "react";
import {Field, reduxForm} from "redux-form";
import './ProfileReduxForm.css'

const ProfileForm = (props) => {
    let xxx = React.createRef();
    return <form onSubmit={props.handleSubmit}>
        <div className="field">
            <h6>Фамилия *</h6>
            <Field className={"input"} value={'sdffffffffff'} placeholder={"Email"} name={"email"} component={"input"}
                   autocomplete="on"/>
        </div>
        <div className="field">
            <h6>Имя *</h6>
            <Field className={"input"} type={"password"} placeholder={"Password"} name={"password"}
                   component={"input"} autocomplete="on"/>
        </div>
        <div className="field">
            <h6>Отчество *</h6>
            <Field className={"input"} type={"password"} placeholder={"Password"} name={"password"}
                   component={"input"} autocomplete="on"/>
        </div>
        <div className="field">
            <h6>Дата рождения *</h6>
            <Field className={"input"} type={"password"} placeholder={"Password"} name={"password"}
                   component={"input"} autocomplete="on"/>
        </div>
        <div className="field">
            <h6>Email *</h6>
            <Field className={"input"} type={"password"} placeholder={"Password"} name={"password"}
                   component={"input"} autocomplete="on"/>
        </div>
        <div className="field">
            <h6>Телефон</h6>
            <Field className={"input"} type={"phone"} placeholder={"Введите номер ( формат 9-999-999-9999)"} name={"password"}
                   component={"input"} autocomplete="on"/>
        </div>
        <div className="field">
            <h6>Пароль *</h6>
            <Field className={"input"} type={"password"} placeholder={"Password"} name={"password"}
                   component={"input"} autocomplete="on"/>
        </div>
        <div className="field">
            <h6>Подтвердите пароль *</h6>
            <Field className={"input"} type={"password"} placeholder={"Password"} name={"password"}
                   component={"input"} autocomplete="on"/>
        </div>
        <button>Сохранить</button>
    </form>
};

const ProfileReduxForm = reduxForm({
    form: 'profile'
})(ProfileForm);

export default ProfileReduxForm
